// custom.js

function updateLetterWidth() {
  const gameuidoc = document.getElementById('game_ui');
  const guessword = document.getElementById('current_guess');
  const previousword = document.getElementById('previous_guesses');

  if (gameuidoc && guessword) {
    const guesswordHeight = Math.max(previousword.firstChild.offsetHeight, guessword.firstChild.offsetHeight);
    gameuidoc.style.setProperty('--guessword-height', `${guesswordHeight}px`);
  }
}

// Create a MutationObserver to watch for changes in the parent
const observer = new MutationObserver((mutations) => {
  mutations.forEach((mutation) => {
    if (mutation.addedNodes.length) {
      updateLetterWidth(); // Call when the target div is added
    }
  });
});

// Start observing the parent element for child node additions
const mycontainer = document.getElementById('mycontainer');
observer.observe(mycontainer, { childList: true, subtree: true });

// Update on window resize
window.addEventListener('resize', updateLetterWidth);

const letters = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ'.split('');
const all_key_ids = [...letters, 'Enter', 'Back'];

document.addEventListener('keydown', function(e) {
  let key = e.code.replace(/^Key/, '');
  if (letters.includes(key)) {
    document.getElementById(key).click();
  } else if (key === 'Enter') {
    document.getElementById('Enter').click();
  } else if (key === 'Backspace') {
    document.getElementById('Back').click();
  }
});

document.addEventListener('touchstart', function(e) {
  if (all_key_ids.includes(e.target.id)) {
    e.target.click();
    e.target.style.pointerEvents = 'none';
    e.preventDefault();
    in_button_touch = true;
  }
});

document.addEventListener('touchend', function(e) {
  all_key_ids.forEach(id => {
    document.getElementById(id).style.pointerEvents = null;
  });
  if (in_button_touch) {
      if (all_key_ids.includes(e.target.id)) {
          // Disable text selection and triggering of click event.
          e.preventDefault();
      }
    in_button_touch = false;
  }
});

/* styles.css */

.container-fluid {
    text-align: center;
    vertical-align: top;
    height: 100%;
    display: grid;
    grid-template-rows: 1fr auto;
    width: fit-content;
}

.shiny-input-text {
    text-align: center;
}

.form-control {
    text-align: center;
}

.guesses .word {
    display: flex;
    white-space: nowrap;
    text-align: center;
    width: 330px;
    max-width: 330px;
    min-width: 330px; /* based on width of fixed size keyboard div */
    margin: auto;
    justify-content: center;
}
.guesses .word .lettercontainer {
    flex: 1;
    max-width: 50px; /* nice size for even big screen */
    aspect-ratio: 1;
    text-align: center;
    vertical-align: middle;
}
.guesses .word .lettercontainer > .letter {
    margin: 10%;
    width: 90%;
    height: 90%;
    text-align: center;
    vertical-align: middle;
    border-radius: 10%;
    line-height: 111.11%; /* relative to width of parent container; has to 'undo' the 90% */
    font-size: calc(0.64 * var(--guessword-height)); /* interacts with custom.js function */
    font-weight: bold;
    user-select: none;
    color: white;
    font-family: 'Clear Sans', 'Helvetica Neue', Arial, sans-serif;
}
.guesses .word .lettercontainer > .correct {
    background-color: #6a5;
    border: 1px solid #6a5;
}
.guesses .word .lettercontainer > .in-word {
    background-color: #db5;
    border: 1px solid #db5;
}
.guesses .word .lettercontainer > .not-in-word {
    background-color: #888;
    border: 1px solid #888;
}
.guesses .word .lettercontainer > .guess {
    color: black;
    background-color: white;
    border: 1px solid black;
}
.keyboard {
    height: 100%;
    margin: 10px 0px;
    user-select: none;
}
.keyboard .keyboard-row {
    margin: 3px;
    white-space: nowrap;
}
.keyboard .keyboard-row .key {
    display: inline-block;
    padding: 0;
    width: 28px;
    height: 40px;
    text-align: center;
    vertical-align: middle;
    border-radius: 3px;
    line-height: 40px;
    font-size: 18px;
    font-weight: bold;
    color: black;
    font-family: 'Clear Sans', 'Helvetica Neue', Arial, sans-serif;
    background-color: #ddd;
    touch-action: none;
}
.keyboard .keyboard-row .key:focus {
    outline: none;
}
.keyboard .keyboard-row .key.wide-key {
    font-size: 15px;
    width: 50px;
}
.keyboard .keyboard-row .key.correct {
    background-color: #6a5;
    color: white;
}
.keyboard .keyboard-row .key.in-word {
    background-color: #db5;
    color: white;
}
.keyboard .keyboard-row .key.not-in-word {
    background-color: #888;
    color: white;
}
.endgame-content {
    font-family: Helvetica, Arial, sans-serif;
    display: inline-block;
    line-height: 1.4;
    letter-spacing: .2em;
    margin: 20px 0px;
    width: 330px;
    max-width: 330px;
    min-width: 330px; /* based on width of fixed size keyboard div */
    overflow-wrap: break-word;
    padding: 20px;
    border-radius: 5px;
    box-shadow: 4px 4px 19px rgb(0 0 0 / 17%);
}
